void RNN_Init(){
	
}
void RNN_SetInput(float * InputX){
	unsigned char j;
	for (j=0;j<7;j++){
	//arm_sub_f32(InputX,Datamean,NNinputX[0],6);
	//arm_mult_f32(NNinputX[0],Datastd_1,NNinputX[0],6);
		NNinputX[0][j] = (InputX[j]-Datamean[j])*Datastd_1[j];
	}
}
void RNN_Predict(){
	static float State1[25];
	static float State2[25];
	static float State3[25];
	static float Z1[30];
	static float Z2[30];
	static float W[50];
	static float b[30];
	static float temprnninput[50];
	
	unsigned char iteration,j;
	
	arm_copy_f32(State1,&NNinputX[0][7],25);
	//First RNN Layer 31 in 25 out
	for(iteration = 0;iteration<25;iteration++){
		for(j = 0;j<31;j++){
			W[j] = rnnW1[iteration][j];
		}
		arm_dot_prod_f32(NNinputX[0],W,32,&State1[iteration]);
		b[iteration] = rnnb1[0][iteration];
	}
	arm_add_f32(State1,b,State1,25);
	for(iteration = 0;iteration<25;iteration++){
		State1[iteration] = State1[iteration]>0?State1[iteration]:0;
	}
	//Copy the result to next input
	
	arm_copy_f32(State1,temprnninput,25);
	arm_copy_f32(State2,&temprnninput[25],25);
	
	
	//Second RNN layer 50 in 25 out
	for(iteration = 0;iteration<25;iteration++){
		for(j = 0;j<50;j++){
			W[j] = rnnW2[iteration][j];
		}
		arm_dot_prod_f32(temprnninput,W,50,&State2[iteration]);
		b[iteration] = rnnb2[0][iteration];
	}
	arm_add_f32(State2,b,State2,25);
	for(iteration = 0;iteration<25;iteration++){
		State2[iteration] = State2[iteration]>0?State2[iteration]:0;
	}
	arm_copy_f32(State2,temprnninput,25);
	arm_copy_f32(State3,&temprnninput[25],25);
	// Third RNN Layer 50 in 25 out
	for(iteration = 0;iteration<25;iteration++){
		for(j = 0;j<50;j++){
			W[j] = rnnW3[iteration][j];
		}
		arm_dot_prod_f32(temprnninput,W,50,&State3[iteration]);
		b[iteration] = rnnb3[0][iteration];
	}
	arm_add_f32(State3,b,State3,25);
	for(iteration = 0;iteration<25;iteration++){
		State3[iteration] = State3[iteration]>0?State3[iteration]:0;
	}
	
	//First Dense 25 in 30 out
	for(iteration = 0;iteration<30;iteration++){
		for(j = 0;j<25;j++){
			W[j] = denseW1[iteration][j];
		}
		arm_dot_prod_f32(State3,W,25,&Z1[iteration]);
		b[iteration] = denseb1[0][iteration];
	}
	arm_add_f32(Z1,b,Z1,30);
	for(iteration = 0;iteration<30;iteration++){
		Z1[iteration] = Z1[iteration]>0?Z1[iteration]:0;
	}
	
	//Second Dense 30 in 30 out;
	for(iteration = 0;iteration<30;iteration++){
		for(j = 0;j<30;j++){
			W[j] = denseW2[iteration][j];
		}
		arm_dot_prod_f32(Z1,W,30,&Z2[iteration]);
		b[iteration] = denseb2[0][iteration];
	}
	arm_add_f32(Z2,b,Z2,30);
	for(iteration = 0;iteration<30;iteration++){
		Z2[iteration] = Z2[iteration]>0?Z2[iteration]:0;
	}
	//Last Dense 30 in 2 out no relu;
	for(iteration = 0;iteration<1;iteration++){
		for(j = 0;j<30;j++){
			W[j] = denseW3[iteration][j];
		}
		arm_dot_prod_f32(Z2,W,30,&output);
		b[iteration] = denseb3[0][iteration];
	}
	output = output + b[0];
	//arm_add_f32(&output,b,output,2);
	
	//Turn into true value
	output = output*Thetastd + Thetamean;
	//output[0] = output[0]*Thetastd[0] + Thetamean[0];
	//output[1] = output[1]*Thetastd[1] + Thetamean[1]; 
	//arm_mult_f32(output,Thetastd,output,2);
	//arm_add_f32(output,Thetamean,output,2);
	if(output>200)
		output = 200;
	if(output<-200)
		output = -200;

}
